Switch(
    droWorkingHours_PositionForm.Selected.Code,
    PositionForm.PresentationData.WorkingHours.Options.Selector.Code,
    With(
        {
            weekHours: {
                From: droWeekFromHour_PositionForm.Selected.Value,
                To: droWeekToHour_PositionForm.Selected.Value
            },
            saturdayHours: If(
                togEnableSaturday_PositionForm.Value,
                {
                    From: droSaturdayFromHour_PositionForm.Selected.Value,
                    To: droSaturdayToHour_PositionForm.Selected.Value
                },
                Blank()
            )
        },
        With(
            {
                weekHoursNumbers: {
                    From: Split(
                        weekHours.From,
                        ":"
                    ),
                    To: Split(
                        weekHours.To,
                        ":"
                    )
                },
                saturdayHoursNumbers: If(
                    IsBlank(saturdayHours),
                    Blank(),
                    {
                        From: Split(
                            saturdayHours.From,
                            ":"
                        ),
                        To: Split(
                            saturdayHours.To,
                            ":"
                        )
                    }
                )
            },
            With(
                {
                    weekHoursIsValid: If(
                        Value(First(weekHoursNumbers.From).Value) = Value(First(weekHoursNumbers.To).Value),
                        Value(Last(weekHoursNumbers.From).Value) <= Value(Last(weekHoursNumbers.To).Value),
                        Value(First(weekHoursNumbers.From).Value) < Value(First(weekHoursNumbers.To).Value)
                    ),
                    saturdayHoursIsValid: IsBlank(saturdayHoursNumbers) || If(
                        Value(First(saturdayHoursNumbers.From).Value) = Value(First(saturdayHoursNumbers.To).Value),
                        Value(Last(saturdayHoursNumbers.From).Value) <= Value(Last(saturdayHoursNumbers.To).Value),
                        Value(First(saturdayHoursNumbers.From).Value) < Value(First(saturdayHoursNumbers.To).Value)
                    )
                },
                {
                    Value: $"Monday to Friday: {weekHours.From} to {weekHours.To}{If(
                        IsBlank(saturdayHours),
                        "",
                        $", Saturday: {saturdayHours.From} to {saturdayHours.To}"
                    )}",
                    WeekHoursIsValid: weekHoursIsValid,
                    SaturdayHoursIsValid: saturdayHoursIsValid,
                    IsValid: weekHoursIsValid && saturdayHoursIsValid
                }
            )
        )
    ),
    PositionForm.PresentationData.WorkingHours.Options.RotativeSchedules.Code,
    {
        Value: PositionForm.PresentationData.WorkingHours.Options.RotativeSchedules.Name,
        IsValid: true,
        WeekHoursIsValid: true,
        SaturdayHoursIsValid: true
    },
    {
        Value: txtWorkingHours_PositionForm.Text,
        IsValid: true,
        WeekHoursIsValid: true,
        SaturdayHoursIsValid: true
    }
)

With(
    {
        selectedItems: comJobActivities_PositionForm.SelectedItems,
        inputItems: OtherJobActivities,
        maxLength: Self.PresentationData.JobActivities.MaxLength
    },
    With(
        {hasContent: !IsEmpty(selectedItems) || !IsEmpty(inputItems)},
        With(
            {
                value: If(
                    hasContent,
                    $"<ul>{Concat(
                        Filter(
                            Ungroup(
                                [
                                    selectedItems,
                                    inputItems
                                ],
                                "Value"
                            ),
                            !IsBlank(Value)
                        ),
                        $"<li>{Value}</li>"
                    )}</ul>",
                    ""
                )
            },
            With(
                {
                    len: Len(value),
                    primaryIsValid: hasContent,
                    otherIsValid: true
                },
                {
                    Value: value,
                    Length: len,
                    PrimaryIsValid: primaryIsValid,
                    OtherIsValid: otherIsValid,
                    IsValid: primaryIsValid && otherIsValid && len <= maxLength
                }
            )
        )
    )
)

